      <Link to="/activate"><button>Aktywacja</button></Link><br /> */}
        <BootstrapNavbar /> 
         <Switch>
          <Route path="/register">
            <Register />
          </Route>
          <Route path="/login">
           <Login />
          </Route>
          <Route path="/activate">
           <Activate />
          </Route>
        </Switch>
      </BrowserRouter>
    </div>
    );
}

export default App;
